// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract TokenAndEthVault {
    using Counters for Counters.Counter;

    // Token contract interface
    IERC20 public token;

    // Key counter for unique generation
    Counters.Counter private _keyCounter;

    // Deposit types
    enum DepositType { TOKEN, ETH }

    // Structure for deposit information
    struct Deposit {
        address depositor;
        uint256 amount;
        bool isWithdrawn;
        DepositType depositType;
    }

    mapping(bytes32 => Deposit) public deposits;
    // mapping(address => bytes32) private latestKeys;
    bytes32 private latestKeys;
    // Event for successful deposits
    event DepositCreated(address indexed depositor, uint256 amount, DepositType depositType);

    // Constructor to set the token contract address
    constructor(address tokenAddress) {
        token = IERC20(tokenAddress);
    }

    // Function to deposit tokens and return a unique key
    function depositTokens(uint256 amount) external returns (bytes32) {
        require(amount > 0, "Deposit amount must be greater than zero");
        require(token.transferFrom(msg.sender, address(this), amount), "Token transfer failed");

        _keyCounter.increment();
        bytes32 key = generateKey(msg.sender, _keyCounter.current());

        deposits[key] = Deposit({
            depositor: msg.sender,
            amount: amount,
            isWithdrawn: false,
            depositType: DepositType.TOKEN
        });
        // latestKeys[msg.sender] =  key;
        latestKeys = key; // Corrected mapping

        emit DepositCreated( msg.sender, amount, DepositType.TOKEN);

        return key;
    }

    // Function to deposit ETH and return a unique key
    function depositETH() external payable returns (bytes32) {
        require(msg.value > 0, "Deposit amount must be greater than zero");

        _keyCounter.increment();
        bytes32 key = generateKey(msg.sender, _keyCounter.current());

        deposits[key] = Deposit({
            depositor: msg.sender,
            amount: msg.value,
            isWithdrawn: false,
            depositType: DepositType.ETH
        });
        // latestKeys[msg.sender] = key;
        latestKeys = key; // Corrected mapping

        emit DepositCreated( msg.sender, msg.value, DepositType.TOKEN); // Corrected event 
        return key;
    }

    // Function to withdraw based on key, either token or ETH
    function withdraw(bytes32 key) external {
        Deposit storage depositInfo = deposits[key];

        require(!depositInfo.isWithdrawn, "Funds have already been withdrawn");
        require(depositInfo.amount > 0, "No deposit found for this key");

        depositInfo.isWithdrawn = true;

        if (depositInfo.depositType == DepositType.TOKEN) {
            require(token.transfer(msg.sender, depositInfo.amount), "Token transfer failed");
        } else if (depositInfo.depositType == DepositType.ETH) {
            payable(msg.sender).transfer(depositInfo.amount);
        }
    }

    // Internal function to generate a unique key
    function generateKey(address depositor, uint256 counter) internal view returns (bytes32) {
        return keccak256(abi.encodePacked(depositor, counter, block.timestamp, address(this)));
    }

    // Function to get the latest deposit key
    // function view_key() external view returns (bytes32) {
    //     if (latestKeys[msg.sender] == bytes32(0)){
    //         return bytes32(0);
    //     }
    //     // require(latestKeys[msg.sender] !=bytes32(0), "No deposits yet");
    //     return latestKeys[msg.sender];
    // }
    function view_key() external view returns (bytes32) {
        if (latestKeys == bytes32(0)){
            return bytes32(0);
        }
        // require(latestKeys !=bytes32(0), "No deposits yet");
        return latestKeys;
    }
}
